        <label for="exampleFormControlTextarea1" className="form-label">
          Example textarea
        </label>
        <textarea
          className="form-control"
          id="exampleFormControlTextarea1"
          rows="3"
        ></textarea>
        </div>
        <button className="btn btn-primary">Uppercase</button>
    </div>
  );
}
